var title_f30_54_31595="Fluids for patients without dehydration";
var content_f30_54_31595=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F82172&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F82172&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Fluids for patients without signs of dehydration",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Acceptable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oral rehydration solution (optimal for both repletion and maintenance)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Salted drinks (salted rice water or salted yogurt drink)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Broth/soup (salted vegetable or meat soup)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Water",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rice water",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Coconut water (unsweetened)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Weak tea (unsweetened)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fresh fruit juice (unsweetened)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Unacceptable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Carbonated beverages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sweetened juices",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Coffee",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medicinal teas or infusions",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Fluids containing salt should be encouraged. Unacceptable fluids include carbonated beverages and sweetened juices; the sugar in these fluids may worsen diarrhea. Coffee and medicinal teas or infusions are also unacceptable since they can have diuretic and purgative effects.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: World Health Organization. The treatment of diarrhea: A manual for physicians and other senior health workers, 4th revision. WHO/FCH/CAH/05.1. World Health Organization, Geneva 2005. (Available at",
"     <a href=\"file://whqlibdoc.who.int/publications/2005/9241593180.pdf\" target=\"_blank\">",
"      file://whqlibdoc.who.int/publications/2005/9241593180.pdf",
"     </a>",
"     ).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
