" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Rituximab desensitization",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"8\">",
"       Desensitization protocol instructions:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       1. Confirm written consent is in medical record. Initial desensitization is performed in the medical ICU.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       2. Please ensure preceding dose of beta-blockers was held, unless otherwise advised by supervising physician.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       3. Obtain IV access, and vital signs (temperature, HR, BP, RR, oxygen saturation, peak flow).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       4. Have at bedside: Epinephrine 0.3 mg (for adult) for IM injection, peak flow meter, and BP cuff.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       5. A nurse must closely observe the patient throughout the protocol (one-to-one).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"8\">",
"       <strong>",
"        Premedicate",
"       </strong>",
"       20 minutes before starting infusion with diphenhydramine (25 mg IV) and ranitidine (50 mg IV)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"8\">",
"       <strong>",
"        Administration:",
"       </strong>",
"       Hang each solution successively, changing the rate every 15 minutes, per protocol. The IV tubing should be pre-flushed with the appropriate solution (1, 2, or 3) and attached at the IV hub, prior to starting infusion with each bag. There is no reason to wait between bags. Vital signs should be taken and recorded every 15 minutes, and every 30 minutes during the last step (step 12).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"5\">",
"       Name of medication:",
"      </td>",
"      <td colspan=\"3\">",
"       <strong>",
"        Rituximab",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"5\">",
"       Target dose, mg",
"      </td>",
"      <td colspan=\"3\">",
"       <strong>",
"        600",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"5\">",
"       Standard volume per bag, mL",
"      </td>",
"      <td colspan=\"3\">",
"       <strong>",
"        250",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"5\">",
"       Final rate of infusion, mL/hr",
"      </td>",
"      <td colspan=\"3\">",
"       <strong>",
