"      <td colspan=\"8\">",
"       <strong>",
"        Total time: 351.875 minutes = 5.86 hours",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"8\">",
"       Monitoring and charting during desensitization:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       Please clearly document any reaction, including:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\" colspan=\"8\">",
"       a. Patient's symptoms, vital signs, and physical findings;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\" colspan=\"8\">",
"       b. Exactly when the reaction occurred (ie, what step, how many minutes into that step);",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\" colspan=\"8\">",
"       c. Treatment administered, how and when the reaction resolved, and when the protocol was restarted.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_left\" colspan=\"8\">",
"       Treatment of allergic reactions:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       1.",
"       <strong>",
"        For mild reactions:",
"       </strong>",
"       In case of isolated itching, flushing, hives, mild chest tightness, nausea, abdominal pain, or back pain, with normal vital signs, stop the infusion and treat with IV Benadryl. Observe patient until the reaction subsides, and then resume the protocol at the point where the infusion was stopped.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       2.",
"       <strong>",
"        For severe reactions:",
"       </strong>",
"       In case of hypotension, throat swelling, wheezing/respiratory distress, or decreased oxygen saturation, stop the infusion and treat with Epinephrine 0.3 mg IM x 1, Benadryl and Solumedrol IV, oxygen, nebulized albuterol for bronchospasm, and IV fluids (normal saline), per AHA guidelines. Place patient in a recumbent position if hypotensive. Consider glucagon 1-2 mg IV bolus if patient has taken beta-blockers, followed by infusion at 1-5 mg/hr.",
"       <strong>",
"        Immediately alert the housestaff and supervising physician.",
"       </strong>",
"       When the patient is stable, the protocol will be resumed as instructed by the supervising physician.",
"       <em>",
"        Patient should be discharged with prescription for an Epipen.",
"       </em>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"8\">",
"       <strong>",
"        Contact the supervising physician for ANY severe or prolonged reaction, or any questions regarding the protocol, reactions, and appropriate management.",
"       </strong>",
"      </td>",
"     </tr>",
"    </table>",
